    {
      "lineNumber": 227614,
      "originalJapaneseLine": "「別に。はい、水。",
      "translatedEnglishLine": "\"It's nothing. Here, water."
    },
    {
      "lineNumber": 227615,
      "originalJapaneseLine": "　見えないから気をつけて飲みなさい」",
      "translatedEnglishLine": "Be careful when you drink since you can't see.\""
    },
    {
      "lineNumber": 227616,
      "originalJapaneseLine": "「わあ、ありがとう」",
      "translatedEnglishLine": "\"Wow, thank you.\""
    },
    {
      "lineNumber": 227617,
      "originalJapaneseLine": "「どうでござる、姉上？",
      "translatedEnglishLine": "\"How is it, elder sister?"
