      "lineNumber": 227619,
      "originalJapaneseLine": "「あ、う、うん……」",
      "translatedEnglishLine": "\"Ah, y-yeah...\""
    },
    {
      "lineNumber": 227620,
      "originalJapaneseLine": "スシヌはそっとはにかんだ。",
      "translatedEnglishLine": "Sushinu smiled shyly to herself."
    },
    {
      "lineNumber": 227621,
      "originalJapaneseLine": "「す、少し……裸でいるにも慣れてきた、かも……」",
      "translatedEnglishLine": "\"I-I might be... getting a little used to being naked...\""
    },
    {
      "lineNumber": 227622,
      "originalJapaneseLine": "「……あ、そ」",
      "translatedEnglishLine": "\"...Oh, I see.\""
    },
    {
      "lineNumber": 227623,
      "originalJapaneseLine": "「ま、あたし達の前を歩いているのは",
      "translatedEnglishLine": "\"Well, the one walking in front of us is"
    },
    {
      "lineNumber": 227624,
      "originalJapaneseLine": "　＜エール＞だから気楽にしてればいいでしょ」",
      "translatedEnglishLine": "‘Eir’, so we can just relax, right?\""
    },
    {
      "lineNumber": 227625,
      "originalJapaneseLine": "「あの男、とりあえず裸の女を",
      "translatedEnglishLine": "\"That man doesn’t seem like the type"
    },
    {
      "lineNumber": 227626,
      "originalJapaneseLine": "　じろじろいやらしい目で",
      "translatedEnglishLine": "to leer at naked women"
