    {
      "lineNumber": 227627,
      "originalJapaneseLine": "　見る奴じゃないみたいだし」",
      "translatedEnglishLine": "with dirty eyes, at least.\""
    },
    {
      "lineNumber": 227628,
      "originalJapaneseLine": "「う、うん、そうだね」",
      "translatedEnglishLine": "\"Y-Yeah, that’s true.\""
    },
    {
      "lineNumber": 227629,
      "originalJapaneseLine": "（私だって……ゼスの姫なんだから……",
      "translatedEnglishLine": "(Even I... am the Princess of Zeth..."
    },
    {
      "lineNumber": 227630,
      "originalJapaneseLine": "　ちゃんと強くならないと……うん……）",
      "translatedEnglishLine": "I have to become strong... yeah...)"
    },
    {
      "lineNumber": 227631,
      "originalJapaneseLine": "（よーし……頑張るぞぉ……）",
      "translatedEnglishLine": "(Alright... I’ll do my best...)"
    },
    {
      "lineNumber": 227632,
      "originalJapaneseLine": "「……って、あれ？」",
      "translatedEnglishLine": "\"...Huh, what’s that?\""
    },
    {
      "lineNumber": 227633,
      "originalJapaneseLine": "「え、あ、あ……」",
      "translatedEnglishLine": "\"Eh, ah, ah...\""
    },
    {
      "lineNumber": 227634,
      "originalJapaneseLine": "「きゃあああああああああ！？」",
      "translatedEnglishLine": "\"Kyaaaaaaaa!?\""
    },
    {
      "lineNumber": 227635,
      "originalJapaneseLine": "「悲鳴！？」",
      "translatedEnglishLine": "\"A scream?!\""
    },
    {
      "lineNumber": 227636,
      "originalJapaneseLine": "「チッ、馬鹿どもが！」",
      "translatedEnglishLine": "\"Tch, idiots!\""
    },
    {
      "lineNumber": 227637,
      "originalJapaneseLine": "「あ、おい、ザンス！」",
      "translatedEnglishLine": "\"Hey, Zans!\""
    },
    {
      "lineNumber": 227638,
      "originalJapaneseLine": "誰よりも早く、ザンスがバイ・ロードを",
      "translatedEnglishLine": "Faster than anyone else, Zans broke away from Bai Road"
    },
    {
      "lineNumber": 227639,
      "originalJapaneseLine": "抜き放ちながら駆けだした。",
      "translatedEnglishLine": "and ran off."
    },
    {
      "lineNumber": 227640,
      "originalJapaneseLine": "「おい、大丈夫か！？」",
      "translatedEnglishLine": "\"Hey, are you okay?!\""
    },
    {
      "lineNumber": 227641,
      "originalJapaneseLine": "「…………アン？」",
      "translatedEnglishLine": "\"...Hmm?\""
    },
    {
      "lineNumber": 227642,
      "originalJapaneseLine": "「あわわわ、は、は、は……」",
      "translatedEnglishLine": "\"Awawawa, h-h-h...\""
    },
    {
      "lineNumber": 227643,
      "originalJapaneseLine": "「裸の女の子ー！？」",
      "translatedEnglishLine": "\"A naked girl!?\""
    },
    {
      "lineNumber": 227644,
      "originalJapaneseLine": "「あぁんっ！」",
      "translatedEnglishLine": "\"Ahn!\""
    },
