    {
      "lineNumber": 227646,
      "originalJapaneseLine": "「……ハニーかよ」",
      "translatedEnglishLine": "\"...That was Honey, huh.\""
    },
    {
      "lineNumber": 227647,
      "originalJapaneseLine": "「お前なぁ、雑魚相手に悲鳴上げてんじゃ――」",
      "translatedEnglishLine": "\"Hey, you’re screaming over weaklings like these—\""
    },
    {
      "lineNumber": 227648,
      "originalJapaneseLine": "「あ、あ、あ……」",
      "translatedEnglishLine": "\"Ah, ah, ah...\""
    },
