      "lineNumber": 227649,
      "originalJapaneseLine": "ザンスを見上げているスシヌの顔が、",
      "translatedEnglishLine": "Sushinu, looking up at Zans, had her face"
    },
    {
      "lineNumber": 227650,
      "originalJapaneseLine": "カーーッと赤く染まっていく。",
      "translatedEnglishLine": "flush bright red."
    },
    {
      "lineNumber": 227651,
      "originalJapaneseLine": "その視線は一点に注がれていた。",
      "translatedEnglishLine": "Her gaze was focused on one spot."
    },
    {
      "lineNumber": 227652,
      "originalJapaneseLine": "「風もないのにぶーらぶら♪」",
      "translatedEnglishLine": "\"Swinging back and forth even with no wind♪\""
    },
    {
      "lineNumber": 227653,
      "originalJapaneseLine": "「にょほほほほ」",
      "translatedEnglishLine": "\"Nyoh ho ho ho ho\""
    },
    {
      "lineNumber": 227654,
      "originalJapaneseLine": "「……あんた、少しは前、隠しなさいよ」",
      "translatedEnglishLine": "\"...You should at least cover up the front a bit.\""
    },
    {
      "lineNumber": 227655,
      "originalJapaneseLine": "「アアン？　俺の体に見られて恥じる点はねえよ。",
      "translatedEnglishLine": "\"Huh? There's nothing to be ashamed of about my body."
    },
    {
      "lineNumber": 227656,
      "originalJapaneseLine": "　この全てが俺の生き様だ」",
      "translatedEnglishLine": "This whole self here is my way of life.\""
    },
    {
      "lineNumber": 227657,
      "originalJapaneseLine": "「……別にあんたの為に言ったわけじゃない」",
      "translatedEnglishLine": "\"...It's not like I said that for your sake or anything.\""
    },
