      "lineNumber": 227658,
      "originalJapaneseLine": "「あ……あ……あ……」",
      "translatedEnglishLine": "\"Ah... ah... ah...\""
    },
    {
      "lineNumber": 227659,
      "originalJapaneseLine": "「ふあああ……！」",
      "translatedEnglishLine": "\"Fuaaa...!\""
    },
    {
      "lineNumber": 227660,
      "originalJapaneseLine": "「あっ、気絶した！」",
      "translatedEnglishLine": "\"Ah, she fainted!\""
    },
    {
      "lineNumber": 227661,
      "originalJapaneseLine": "「姉上には刺激が強すぎたでござるな」",
      "translatedEnglishLine": "\"That was too much stimulation for elder sister, wasn’t it?\""
    },
    {
      "lineNumber": 227662,
