      "translatedEnglishLine": "\"Good grief, this one really...\""
    },
    {
      "lineNumber": 227663,
      "originalJapaneseLine": "「あんたのせいでしょうが！」",
      "translatedEnglishLine": "\"It’s your fault, you know!\""
