    {
      "lineNumber": 227664,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........."
    },
    {
      "lineNumber": 227665,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 227666,
      "originalJapaneseLine": "「ax2 + bx + c = 0 ( a≠ 0 )の解は",
      "translatedEnglishLine": "\"The solution to ax^2 + bx + c = 0 (a = 0) is"
    },
    {
      "lineNumber": 227667,
      "originalJapaneseLine": "　x = ( -b ± SQRT( b2 - 4ac ) ) / ( 2a )",
      "translatedEnglishLine": "x = (-b ± SQRT(b^2 - 4ac)) / (2a)"
    },
    {
      "lineNumber": 227668,
      "originalJapaneseLine": "　ブツブツブツブツ……」",
      "translatedEnglishLine": "Mumbling mumbling mumbling...\""
    },
    {
      "lineNumber": 227669,
      "originalJapaneseLine": "「ひーっ、姉上が怖いでござるー」",
      "translatedEnglishLine": "\"Eek, elder sister is scary!\""
    },
    {
      "lineNumber": 227670,
      "originalJapaneseLine": "「ほら、あんたちゃんと歩きなさいよ」",
      "translatedEnglishLine": "\"Come on, you better walk properly.\""
    },
    {
      "lineNumber": 227671,
